style.css:
body {
    background-color: #f0f0f0;
}

agent_screen {
    background-color: #fff;
    max-width: 800px;
    margin: 0 auto;
    padding: 20px;
}

h1, h2, h3 {
    color: #333;
    font-family: Arial, sans-serif;
}

p {
    color: #666;
    font-size: 14px;
}

button {
    background-color: #007bff;
    color: #fff;
    border: none;
    padding: 10px 20px;
    cursor: pointer;
}

button:hover {
    background-color: #0069d9;
}
